private boolean isSuggestionForReal(RankedSpellPossibility rsp) {
  for (SpellCheckCorrection corr : rsp.getCorrections()) {
    if (!corr.getOriginalAsString().equals(corr.getCorrection())) {
      return true;
    }
  }
  return false;
}

